INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'1', N'国华九江电厂对送修返厂的一次风机及时组织验收', N'技术人员正在对一次风机静心验收', N'<p style="margin-top:0;margin-right:0;margin-bottom:0;text-indent:37px;line-height:24px"><span style="font-family: 宋体;letter-spacing: 0;font-size: 19px;background: rgb(255, 255, 255)"><span style="font-family:宋体">验收人员依据与厂家签订的送修合同，认真检查修后设备的技术性能是否达到质量标准要求，核实委托修理项目是否全部完成，对轮毂上的新增动平衡块牢固性进行检验，对轴承箱中分面车削后的平整度试验校对，重点对中心筒内的加固筋板进行仔细核对，本次返厂除了常规的检查外，我厂针对两台一次风机运行中振动大问题提出对中心筒加固的想法，厂家积极配合，由技术人员对加固方案进行完善优化，中心筒的支撑筋板有原来的三根更改为对称布置的六根。</span></span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;text-indent:37px;line-height:24px"><span style="font-family: 宋体;letter-spacing: 0;font-size: 19px;background: rgb(255, 255, 255)"><span style="font-family:宋体">经过我厂技术人员的认真检查，委托修理完成率</span>100%，质量合格，送修设备经过喷涂后焕然一新，后续将根据已审定的回装方案进行风机的回装。</span></p><p>我就是不相信你们会这么做</p><p>要不再生成一次？</p><p>把无用样式删除了再来一次？</p><p>有问号就会出问题吗？</p>', N'文章摘要', N'/upfiles/images/20200513/0df0158265824384a4a9aabfb20d4ff2.jpg', N'0', N'1', N'0', N'', N'0', N'0', N'于硕', N'软件开发部', N'0', N'2020-05-13 15:05:00.000', N'0', N'2020-05-13 15:05:00.000', N'', N'0', N'0')
GO

INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'2', N'我的第一篇博客', N'技术人员正在对一次风机静心验收', N'<p><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.92px; background-color: rgb(255, 255, 255);">下决心做好自媒体到现在有一个月了，关注我的兄弟应该知道我产出了不少文章，号里的粉丝也多起来了，我也尽最大努力做到有问必回，现在是基础的、高深的问题都接踵而来，可我也只是一只小菜鸟，想飞也飞不动了(┬＿┬)，昨天号里有位朋友被面试官问到可空类型的原理，回答的不好，面试官也是，面就面呗，又给不了多少银子，还动不动就原理，哪有那么多原理，搞得双方都尴尬</span></p>', N'', N'/upfiles/images/20200514/404a6cc89d104bc18efc96c551569e4c.jpg', N'0', N'1', N'0', N'', N'1', N'0', N'', N'', N'11297175912976384', N'2020-05-14 15:48:54.000', N'0', N'1900-01-01 00:00:00.000', N'', N'0', N'0')
GO

INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'3', N'真源新闻内容哦', N'真源的新闻内容', N'<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-size: 15px; line-height: 24px; color: rgb(103, 106, 108); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 37px;"><span style="box-sizing: border-box; font-family: 宋体; letter-spacing: 0px; font-size: 19px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="box-sizing: border-box;">验收人员依据与厂家签订的送修合同，认真检查修后设备的技术性能是否达到质量标准要求，核实委托修理项目是否全部完成，对轮毂上的新增动平衡块牢固性进行检验，对轴承箱中分面车削后的平整度试验校对，重点对中心筒内的加固筋板进行仔细核对，本次返厂除了常规的检查外，我厂针对两台一次风机运行中振动大问题提出对中心筒加固的想法，厂家积极配合，由技术人员对加固方案进行完善优化，中心筒的支撑筋板有原来的三根更改为对称布置的六根。</span></span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-size: 15px; line-height: 24px; color: rgb(103, 106, 108); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 37px;"><span style="box-sizing: border-box; font-family: 宋体; letter-spacing: 0px; font-size: 19px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="box-sizing: border-box;">经过我厂技术人员的认真检查，委托修理完成率</span>100%，质量合格，送修设备经过喷涂后焕然一新，后续将根据已审定的回装方案进行风机的回装。</span></p><p>&nbsp;<img src="../../upfiles/images/20200518/5ec24da3569ee4402409a24f.bmp" title="微信图片_20200424101216.bmp" alt="微信图片_20200424101216.bmp"/></p>', N'', N'/upfiles/images/20200518/563ef81815474a248bb7e40d828a7463.jpg', N'0', N'1', N'0', N'', N'1', N'0', N'于硕', N'软件开发部', N'11297175912976384', N'2020-05-18 16:55:27.000', N'0', N'2020-05-18 16:55:27.000', N'', N'0', N'0')
GO

INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'5', N'EasyCMS', N'EasyCMS', N'<p>范德萨范德萨</p>', N'EasyCMS是采用2020年最新主流技术开发的开源.NET Core CMS系统。架构科学，轻松支持上千万数据、千万PV；支持全站静态化，SSI，动态页面局部静态化等为您快速建站，建设大规模站点提供强大驱动，也是企业级项目产品原型的良好选择。', N'/upfiles/images/20200604/37fa44c712934b1ebca9919fd10bd056.png', N'0', N'5', N'0', N'', N'1', N'0', N'', N'', N'11297175912976384', N'2020-05-19 12:36:24.000', N'0', N'2020-05-19 12:36:24.000', N'', N'0', N'0')
