INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'6', N'推出定制跑鞋和机器人工厂，阿迪达斯找到未来的方向了吗？', N'技术人员正在对一次风机静心验收', N'<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">接下来，阿迪达斯的 AM4（Adidas Made For）系列还将为上海、洛杉矶、纽约等城市设计独有的跑鞋，并针对每个城市的情况调整设计。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">AM4 系列挺特别的，除了因为它是针对不同城市生活方式设计之外，还因为这是阿迪达斯在自动化工厂 Speedfactory 生产的首个系列产品。</p><h3 style="box-sizing: border-box; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 23px; color: rgb(61, 70, 77); margin: 40px 0px 14px; font-size: 15px; border: 0px; outline: 0px; padding: 0px 0px 0px 14px; vertical-align: baseline; white-space: normal; position: relative; background-color: rgb(255, 255, 255); text-indent: 2em;">机器人工厂不只是为了提高效率，更是为了探寻未来</h3><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">这就是创造业的未来。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">以运动员数据为导向，开源的联合设计。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">人和机器的结合。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">旁白在伴随 AM4LDN 发布的 Speedfactory 介绍视频中如此介绍道。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">Speedfactory 位于德国城市安斯巴赫，离阿迪达斯德国黑措根奥拉赫总部大约 35 英里。作为阿迪达斯第一家“机器人工厂”，Speedfactory 从外观看起来却挺普通的。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255); text-indent: 2em;">据《连线》<a href="https://www.wired.com/story/inside-speedfactory-adidas-robot-powered-sneaker-factory/" style="box-sizing: border-box; background-color: transparent; color: rgb(61, 70, 77); text-decoration-line: none; border-width: 0px 0px 1px; border-style: solid; border-color: rgb(153, 153, 153); border-image: initial; font-style: inherit; font-weight: bold; outline: none; padding: 0px 0px 1px; margin: 0px; vertical-align: baseline; transition: all 0.2s ease 0s; cursor: pointer; overflow-wrap: break-word;">介绍</a>，它是一座坐落于玉米田间的白色办公楼。办公楼外部挂着阿迪达斯的旗子，并印着 Oechsler Motion 的 logo。后者是德国的自动化公司，它是阿迪达斯的长期合作伙伴，也是这家 Speedfactory 的运营者。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; white-space: normal; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; background-color: rgb(255, 255, 255);"><br/></p><p><br/></p>', N'', N'/upfiles/images/20200603/2b95153c05374165b958b38d9003fd63.jpg', N'0', N'6', N'0', N'', N'1', N'0', N'', N'', N'11297175912976384', N'2020-05-19 12:36:39.000', N'0', N'2020-05-19 12:36:39.000', N'', N'0', N'0')
GO

INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'7', N'做汽车维修技师的在线学习和技术支持平台，「总监修车」目前已有1800多家付费用户', N'做汽车维修技师的在线学习和技术支持平台，「总监修车」目前已有1800多家付费用户', N'<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">我近期接触的“总监修车”是一家做汽车维修技师的在线学习和技术支持平台，于2016年年底成立。汽车维修技师可以通过APP既可以在线学习目前市场主流车型维修技术课程，也可以查询更多中高端品牌车型的原厂维修技术资料数据。后期正在开发在线技术疑难指导板块，目前是以收取会员费的形式提供服务，2017年4月初上线以来已有13000+会员，付费会员超过1800+。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">“总监修车”创始人霍晓刚认为，从用户端来看，“总监修车”的需求是存在的，技师用户的细分学习场景有在线原厂技术视频、线下专品牌课程录制视频、原厂维修手册、技术通报、技术案例、快修保养数据查询等维修车间常用技术信息。用户类型主要是线下维修店店长、中高端品牌连锁店技师、4S店技师等，“总监修车”还可以满足维修店定制课程需求，可以让更多有技术需求的用户来到“总监修车”平台学习。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在“总监修车”平台上用户可以选择是原厂视频课程、线下录制课程、企业定制课程等，还可以实时查询海量原厂数据资料，厂家技术通报、技术案例等，平台还可以提供顾问式疑难问题技术支持，以增加用户和平台更深的粘度。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在服务品质方面“总监修车”找到了国内各大品牌数百位技术精英及专家，有国内一线维修技术数据搜集、编辑、撰写以及技术支持团队，每个主流品牌多位技术总监负责制，以保证对用户服务的专业的及时性。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在盈利模式上，“总监修车”主要基于在线学习+技术支持+门店捆绑式产品销售为主要来源，后期总监修车还将开发更多的技术+服务+产品的套餐作为盈利来源。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">根据目前“总监修车”数据显示，从今年4月“总监修车”上线以来至今，平台已有1800+的付费用户，其中维修门店及维修企业用户占总数的60以上%，未来“总监修车”平台会开发更多的技术课程及数据，帮助更多的技师以及门店提高的技术专业度，增加用户与平台的互动频率，提高用户基数，增加总监修车的产品植入宽度以及深度。创始人兼CEO霍晓刚是深耕汽车维修行业一线二十年，有较强的门店技术及管理能力和资源。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75;"><br/></p><p><br/></p>', N'', N'/upfiles/images/20200603/02ba09bf50ff47309111c388bcab38ce.jpg', N'0', N'6', N'0', N'', N'1', N'0', N'', N'', N'11297175912976384', N'2020-05-19 12:37:02.000', N'0', N'2020-05-19 12:37:02.000', N'', N'0', N'0')
