INSERT INTO [dbo].[cms_content] ([id], [title], [sub_title], [content], [summary], [cover_image], [dept_id], [channel_id], [ip_limit], [tags], [status], [is_top], [author], [source], [insert_id], [insert_time], [update_id], [update_time], [content_href], [hit_count], [is_recommend]) VALUES (N'8', N'人工智能进化史：从麦卡锡到“索菲亚”', N'人工智能进化史：从麦卡锡到“索菲亚”', N'<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">我近期接触的“总监修车”是一家做汽车维修技师的在线学习和技术支持平台，于2016年年底成立。汽车维修技师可以通过APP既可以在线学习目前市场主流车型维修技术课程，也可以查询更多中高端品牌车型的原厂维修技术资料数据。后期正在开发在线技术疑难指导板块，目前是以收取会员费的形式提供服务，2017年4月初上线以来已有13000+会员，付费会员超过1800+。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">“总监修车”创始人霍晓刚认为，从用户端来看，“总监修车”的需求是存在的，技师用户的细分学习场景有在线原厂技术视频、线下专品牌课程录制视频、原厂维修手册、技术通报、技术案例、快修保养数据查询等维修车间常用技术信息。用户类型主要是线下维修店店长、中高端品牌连锁店技师、4S店技师等，“总监修车”还可以满足维修店定制课程需求，可以让更多有技术需求的用户来到“总监修车”平台学习。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在“总监修车”平台上用户可以选择是原厂视频课程、线下录制课程、企业定制课程等，还可以实时查询海量原厂数据资料，厂家技术通报、技术案例等，平台还可以提供顾问式疑难问题技术支持，以增加用户和平台更深的粘度。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在服务品质方面“总监修车”找到了国内各大品牌数百位技术精英及专家，有国内一线维修技术数据搜集、编辑、撰写以及技术支持团队，每个主流品牌多位技术总监负责制，以保证对用户服务的专业的及时性。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">在盈利模式上，“总监修车”主要基于在线学习+技术支持+门店捆绑式产品销售为主要来源，后期总监修车还将开发更多的技术+服务+产品的套餐作为盈利来源。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 26px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75; overflow-wrap: break-word; color: rgb(61, 70, 77); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, &quot;\\5FAE软雅黑&quot;, STHeitiSC-Light, simsun, &quot;\\5B8B体&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;">根据目前“总监修车”数据显示，从今年4月“总监修车”上线以来至今，平台已有1800+的付费用户，其中维修门店及维修企业用户占总数的60以上%，未来“总监修车”平台会开发更多的技术课程及数据，帮助更多的技师以及门店提高的技术专业度，增加用户与平台的互动频率，提高用户基数，增加总监修车的产品植入宽度以及深度。创始人兼CEO霍晓刚是深耕汽车维修行业一线二十年，有较强的门店技术及管理能力和资源。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; padding: 0px; vertical-align: baseline; line-height: 1.75;"><br/></p><p><br/></p>', N'', N'', N'0', N'7', N'0', N'', N'1', N'0', N'', N'', N'11297175912976384', N'2020-05-19 12:37:18.000', N'0', N'1900-01-01 00:00:00.000', N'', N'0', N'0')
GO

