INSERT INTO [dbo].[cms_template] ([id], [template_name], [template_file], [file_name], [template_mode], [pid], [template_content], [edit_time], [edit_id], [insert_id], [insert_time], [is_default]) VALUES (N'5', N'新闻详情', N'T_新闻详情.html', N'', N'3', N'3', N'<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta name="applicable-device" content="pc,mobile">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <title>{$:news.title}</title>
    <meta name="keywords" content="{$:news.title}">
    <meta name="description" content="{$:news.title}">
    <link href="/hplus/css/bootstrap.min14ed.css?v=3.3.6" rel="stylesheet">
    <link href="/hplus/css/font-awesome.min93e3.css?v=4.4.0" rel="stylesheet">
    <link href="/hplus/css/style.min862f.css?v=4.1.0" rel="stylesheet">

</head>

<body class="gray-bg">
    <div class="wrapper wrapper-content  animated fadeInRight article">
        <div class="row">
            <div class="col-lg-10 col-lg-offset-1">
                <div class="ibox">
                    <div class="ibox-content">
                        <div class="pull-left">
                            当前位置：{$news.location}
                        </div>
                        <div class="pull-right">
                            <button class="btn btn-white btn-xs" type="button">作者：{$news.author}</button>
                            <button class="btn btn-white btn-xs" type="button">来源：{$news.source}</button>
                            <button class="btn btn-white btn-xs" type="button">发布时间：{$news.publish_time format="yyyy-MM-dd"}</button>
                        </div>
                        <div class="text-center article-title">
                            <h1>
                                {$news.title length=50}
                            </h1>
                        </div>
                        <div class="article-content">
                            {$news.content}
                        </div>
                        <hr>

                    </div>
                </div>
            </div>
        </div>
    </div>
    <script src="/hplus/js/jquery.min.js?v=2.1.4"></script>
    <script src="/hplus/js/bootstrap.min.js?v=3.3.6"></script>
    <script src="/plugins/ckplayer/ckplayer.min.js"></script>
</body>
</html>

', N'2020-05-19 16:18:06.000', N'11297175912976384', N'1', N'2020-05-15 10:53:30.000', N'1')
GO

INSERT INTO [dbo].[cms_template] ([id], [template_name], [template_file], [file_name], [template_mode], [pid], [template_content], [edit_time], [edit_id], [insert_id], [insert_time], [is_default]) VALUES (N'6', N'首页模板', N'T_首页模板.html', N'index.html', N'1', N'1', N'<!DOCTYPE html>
<html id="doc">
<vt:include id="navi" file="Template/include/header.html" charset="utf-8" />
<body class="home blog">
    <div class="wrapper">
        <vt:include id="navi" file="Template/include/navi.html" charset="utf-8" />
        <div class="container-fluid mini"></div>
        <section id="slider" class="container-full">
            <div class="swiper-container">
                <div class="swiper-wrapper">
                    <vt:template name="channels" type="Banner" total="2">
                        <vt:foreach from="$#.contents" item="#.news" index="#.i">
                            <div class="swiper-slide">
                                <a href="javascript:;" title="{$#.news.title}">
                                    <img src="{$#.news.cover_image}" alt="{$#.news.title}" style="width:1900px;height:495px">
                                </a>
                            </div>
                        </vt:foreach>
                    </vt:template>
                </div>
                <div class="swiper-pagination big-p1"></div>
                <div class="icon-arrows-left icon"></div>
                <div class="icon-arrows-right icon"></div>
            </div>
        </section>
        <Section id="content">
            <div class="container">
                <div class="row">
                    <div class="col-md-4 col-xs-12 col-sm-6">
                        <ul class="nav nav-tabs" role="tablist">
                            <li role="presentation" class="active"><a href="#home" aria-controls="idx-about" role="tab" data-toggle="tab">公司介绍</a></li>
